def get_delegatee(vm_state, delegator):
    contract_address = None
    transaction_context = BaseTransactionContext(0, delegator)

    encoded_function_signature = keccak("getDelegatee(address)".encode())
    function_signature = encoded_function_signature[0:4]
    encoded_parameter = encode_single('address', encode_hex(delegator))
    data = function_signature + encoded_parameter

    message = Message(
        gas=200000,
        to=stamina,
        sender=delegator,
        value=0,
        data=data,
        code=code,
        create_address=contract_address,
    )

    computation = vm_state.get_computation(
        message,
        transaction_context).apply_message()

    assert computation.is_success
    return computation.output


